import logo from './logo.svg';
import './App.css';

const src = "moita.mp3"

function App() {
  return (
      <div className="body">
        <div className="top-nav"></div>
        <div className="middle-nav"></div>
        <div className="bottom-nav">
          <audio controls>
            <source src={song.src}></source>
          </audio>
        </div>
      </div>
  );
}

export default App;
